if(isset($_POST['message'])&&isset($_POST['name'])&&isset($_POST['email']))
{
	require '../phpmailer/PHPMailerAutoload.php';
	$localn = file("../footer/Email.txt");
	$hostn=implode(" ",$localn);
	$dbtf = file("../passe.txt");
	$udbs=implode(" ",$dbtf);
	$mail=new PHPMailer;
	$mail->Host='smtp.gmail.com';
	$mail->Port=587;
	$mail->SMTPAuth=true;
	$mail->SMTPSecure='ssl';
	$mail->Username='$hostn';
	$mail->Password='$udbs';
	$mail->setFrom($_POST['email'],$_POST['name']);
	$mail->addAddress('smarzabal@gmail.com');
	$mail->addReplyTo($_POST['email'],$_POST['name']);
	$mail->isHTML(true);
	$mail->Subject='Message Us Form Submission:'.$_POST['name'];
	$mail->Body='<h1 align="center">Email:'.$_POST['email'].'<br>Name'.$_POST['name'].'</h1>'.'<br>'.'Message'.$_POST['message'].'';
	if(!$mail->send()){
		$result=1;
	}
	else
	{
		$result=0;
	}
	$azee=$mail->ErrorInfo;
	if($result==1)
	{
		echo'<script>alert("Message not Sent Connnection error '.$azee.'");</script>';
		unset($_POST);
		echo'<script>
			if ( window.history.replaceState ) {
			window.history.replaceState( null, null, window.location.href );
			}
			</script>';
	}
	else
	{
		echo'<script>alert("Message Has been Sent");</script>';
		unset($_POST);
		echo'<script>
			if ( window.history.replaceState ) {
			window.history.replaceState( null, null, window.location.href );
			}
			</script>';
	}
	unset($_POST);
}
